  return (
    <div>
      <div className={classes.ImageBackground}>
        <img
          src="https://media.geeksforgeeks.org/wp-content/uploads/forkandgeeksclassesV-min.png"
          alt="rounded-image"
          width="800"
          height="400"
        ></img>
      </div>
    </div>
  );
}
